
public class Relational1 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int x = 10; // 10 value which will be stored into x variable
		int y = 10; // 10 value which will be stored into y variable
		System.out.println(x > y); //10>10 false, false
		System.out.println(x < y); //10<10 true, false
		System.out.println(x >= y); //10>=10 false, true
		System.out.println(x <= y); //10<=10 true, true
		System.out.println(x == y); //10==10 false, true
		System.out.println(x != y); //10!=10 true, false

	}

}
